description:
De godvrezende blueslegende Lazarus Woods vindt op een verlaten weg de voor dood achtergelaten Rae.
Hij brengt haar naar zijn huis en neemt de taak op zich Rae te genezen van haar seksverslaving.
Hij bindt haar met een zware ketting vast aan zijn verwarming om de duivel uit haar te drijven. &lt;a href=&quot;
